import React from "react";
import Main from "./components/Main";
import Header from "./components/Header";
import Footer from "./components/footer";

function App() {
  let arr = [1, 2, 3, 7, 4, 3];

  let arr2 = arr
    .filter(function filter(item, index) {
      return item > 6;
    })
    .map((item) => {
      return item + 2;
    })
    .filter((item) => {
      return item > 8;
    });

  <>
    <div className="container number ">{arr2}</div>
  </>;
}
export default App;
